import React from 'react';
import './App.css';
import {fetchImageUrls} from './imageUtils'


function App() {
  const [imageSources, setImageSources] = React.useState([]);

  React.useEffect(() => {
    fetchImageUrls().then(imageUrls => setImageSources(imageUrls))
  }, [])



  return (
    <div className='container'>
      <div className='row justify-content-center mt-4'>Images</div>
      <div className='row mt-5'>{imageSources.map(image => <div className='col col-md-3 mt-4'><img crossOrigin='anonymous' src={image}></img></div>)}</div>
    </div>
  );
}

export default App;
